import React from 'react'
import Final from './Components/Navbar'
import Header from '../src/Components/Header'
import {makeStyles} from "@material-ui/core"
import './index.css'
import woodstockWide from "../src/Assets/woodstock_wide.jpeg"

const useStyles = makeStyles((theme) => ({
  color_green : {
      color: '#009688',
      alignItems:"center",
      justifyContent:"center",
      fontSize:"55px"
    },
  color_yellow : {
      color: "#fdd835",
      alignItems:"center",
      justifyContent:"center",
      fontSize:"45px"
  },
  image:{
    width:"400px"
  }
}))

function App() {
  const classes = useStyles()
  return (
    <div className='container' style={{backgroundColor: 'orange'},{height: '100vh'}}>
      <Header/>

      <h2 className={classes.color_green}> - 1960's Concert tickets -  </h2>
      <h2 className={classes.color_yellow}> - On chain metadata - </h2>
      <h2 className={classes.color_green}> - Forever - </h2>
      <Final />
      <div>
        <img src={woodstockWide} alt=""/>
      </div>
    </div>
  );
}

export default App;
